import React from 'react';
import Card from './Card';

const CardList = ({cats}) => {
  const catComponent = cats.map((cat, i) => {
    return <Card id={cats[i].id} name={cats[i].name} loves={cats[i].loves}/>
  });

  return (
    {catComponent}
  );
}

export default CardList;
